import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import HomeIcon from '@material-ui/icons/Home';
import Toolbar from '@material-ui/core/Toolbar';
import { makeStyles } from '@material-ui/core/styles';
import { Link as LinkRouter } from 'react-router-dom';
import grey from '@material-ui/core/colors/grey';
import styled from 'styled-components'
import Modal from "react-modal";
import CreateIcon from '@material-ui/icons/Create';
import CreateOutlinedIcon from '@material-ui/icons/CreateOutlined';
import CreateRoundedIcon from '@material-ui/icons/CreateRounded';
import CreateTwoToneIcon from '@material-ui/icons/CreateTwoTone';
import CreateSharpIcon from '@material-ui/icons/CreateSharp';

const HomeButton = styled(Button)`
  color: white;
  font-size: 20px;
`
const Head = styled(AppBar)`
  position: -webkit-sticky;
  position: sticky;
  top: 0px;
`
// const Createicon = styled(CreateIcon)`
//   position: sticky;
//   top: 134px;
//   color: #3f51b5;
//   font-size: 25px;
//   border: 3px groove #3f51b5;
//   border-radius: 7px;
//   background-color: #3f51b5;
// `

const Header: React.FC =  () => {

  const useStyles = makeStyles((theme) => ({
    white: {
      color: grey[50],
    },
    textDecorationNone: {
      textDecoration: 'none',
    },
  }));

  const classes = useStyles();

  const [modalIsOpen, setIsOpen] = React.useState(false);


  return (
    <React.Fragment>
      <Head position="relative">
        <Toolbar>
          <LinkRouter to="/" className={classes.textDecorationNone}>
            <HomeButton startIcon={<HomeIcon style={{ fontSize: 35 }}/>}>
              HOME
            </HomeButton>
          </LinkRouter>
          <button onClick={() => setIsOpen(true)}><CreateIcon/></button>
          <Modal isOpen={modalIsOpen}>
            <button onClick={() => setIsOpen(false)}>Close Modal</button>
          </Modal>
        </Toolbar>
      </Head>
    </React.Fragment>
  );
}

export default Header;
